var PidTuner = {};
PidTuner.await = function() {
    return new Promise(async (resolve, reject) => {
        // wait for Arma load
        await Arma.await();
        // memory management for PID classes
        Arma.pid_model.prototype.destroy = function() {
            Arma.destroy(this);
        };
        Arma.pid_tuner.prototype.destroy = function() {
            Arma.destroy(this);
        };
        // resolve
        resolve();
    });
}

